fields.plain_content:
{% load evaluation_filters %}(English version below)


Sehr geehrte Dozentin, sehr geehrter Dozent,

die folgenden Evaluierungsergebnisse wurden soeben veröffentlicht:
{% for evaluation in evaluations|order_by:"full_name_de" %}    - {{ evaluation.full_name_de }}
{% endfor %}
Die Ergebnisse können auf EvaP{% if not user.needs_login_key %} ({{ page_url }}){% endif %} eingesehen werden.{% if user.needs_login_key and login_url %} Hier klicken zum Anmelden: {{ login_url }}{% elif user.needs_login_key %} Ein Link zum Anmelden wird per E-Mail zugesendet.{% endif %}

Bei Fragen und Rückmeldungen stehen wir gerne zur Verfügung ({{ contact_email }}).

Freundliche Grüße,
das Evaluierungsteam

(Dies ist eine automatisch versendete E-Mail.)


--


Dear lecturer,

the results of the following evaluations have just been published:
{% for evaluation in evaluations|order_by:"full_name_en" %}    - {{ evaluation.full_name_en }}
{% endfor %}
You can view the results on EvaP{% if not user.needs_login_key %} ({{ page_url }}){% endif %}.{% if user.needs_login_key and login_url %} Click here to login: {{ login_url }}{% elif user.needs_login_key %} We will send you a one-time login URL in a separate email.{% endif %}

If you have any questions or feedback, please let us know ({{ contact_email }}).

Kind regards,
the Evaluation Team

(This is an automated message.)

fields.html_content:
{% load evaluation_filters %}
<i>(English version below)</i><br /><br /><br />


Hallo {{ user.first_name }},<br /><br />

für die folgenden Evaluierungen hat die Evaluierungsphase begonnen:
<ul>{% for evaluation, due_in_days in evaluations %} 
<li>{{ evaluation.full_name_de }}
(endet {% if due_in_days == 0 %}heute{% elif due_in_days == 1 %}morgen{% else %}in {{ due_in_days }} Tagen{% endif %})</li>
{% endfor %}</ul><br />

Du kannst dein Feedback auf EvaP{% if not user.needs_login_key %} (<a href="{{ page_url }}">{{ page_url }}</a>){% endif %} abgeben, die Mitwirkenden und wir freuen uns über deine Bewertung. Bei Fragen und Rückmeldungen kannst du dich jederzeit an uns wenden (<a href="mailto:{{ contact_email }}">{{ contact_email }}</a>).<br /><br />

{% if user.needs_login_key %}
Klicke hier, um dich anzumelden: <a href="{{ login_url }}">{{ login_url }}</a><br /><br />
{% endif %}

{% if due_evaluations|length > 1%}
Diese Evaluierungen warten auf deine Bewertung:
<ul>{% for evaluation, due_in_days in due_evaluations %}
<li>{{ evaluation.full_name_de }} (endet {% if due_in_days == 0 %}heute{% elif due_in_days == 1 %}morgen{% else %}in {{ due_in_days }} Tagen{% endif %})</li>
{% endfor %}</ul><br />
{% endif %}

Vielen Dank für deine Mühe und viele Grüße,<br />
das Evaluierungsteam<br /><br />

<i>(Dies ist eine automatisch versendete E-Mail.)</i><br /><br />

<hr><br /><br />

Dear {{ user.first_name }},<br /><br />

The evaluation period for the following evaluations just started:
<ul>{% for evaluation, due_in_days in evaluations %}
<li>{{ evaluation.full_name_en }}
(ends {% if due_in_days == 0 %}today{% elif due_in_days == 1 %}tomorrow{% else %}in {{ due_in_days }} days{% endif %})</li>
{% endfor %}</ul><br />

You can evaluate them on EvaP{% if not user.needs_login_key %} (<a href="{{ page_url }}">{{ page_url }}</a>){% endif %}. The lecturers and we are looking forward to receive your feedback. If you have any questions or feedback, please let us know (<a href="mailto:{{ contact_email }}">{{ contact_email }}</a>).<br /><br />

{% if user.needs_login_key %}
Click here to login: <a href="{{ login_url }}">{{ login_url }}</a><br /><br />
{% endif %}
{% if due_evaluations|length > 1%}
These evaluations are waiting for your feedback:
<ul>{% for evaluation, due_in_days in due_evaluations %}
<li>{{ evaluation.full_name_en }} (ends {% if due_in_days == 0 %}today{% elif due_in_days == 1 %}tomorrow{% else %}in {{ due_in_days }} days{% endif %})</li>
{% endfor %}</ul><br />
{% endif %}

Thank you very much for your efforts and kind regards,<br />
the Evaluation Team<br /><br />

<i>(This is an automated message.)</i>

